import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function MoveList({ pokemon }) {

  return (
    <div>
      <h2>Move List</h2>
      <ul>
        {pokemon.moves.map(move => (
          <li key={move}>{move.move.name}</li>
        ))}
      </ul>
    </div>
  );
}
